private GeoPoint getPointRigthLon(List<GeoPoint> points) {
  GeoPoint rPoint = null;
  for (GeoPoint point : points){
    if(rPoint == null ){
      rPoint = point;
    }
    else{
      if (rPoint.getLongitude() < point.getLongitude()){
        rPoint = point;
      }
    }
  }
  return rPoint;
}

